import React from "react";
//import hello from "./hello.png";
import "./App.css";



function Login() {
  return (
    <div className="h-full">
      <div className="flex items-center justify-center ">
        
        <div className="w-1/3">
          
            <div className="flex flex-col items-center justify-center w-full mt-10 bg-white p-16 rounded-xl mx-12">
              <h1 className="text-4xl font-bold bg-white p-4">Login</h1>
              <input
                type="text"
                placeholder="Username"
                className="w-full px-5 py-2.5 mb-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-red-300 focus:border-transparent"
              />
              
              <input
                type="password"
                placeholder="Password"
                className="w-full px-5 py-2.5 mb-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-red-300 focus:border-transparent"
              />
              
              <button
                type="button"
                className="w-full px-5 py-2.5 mb-2 text-white bg-red-700 rounded-lg focus:outline-none hover:bg-red-800 focus:ring-2 focus:ring-red-300 focus:ring-opacity-50"
              >
                Login
              </button>
              
            </div>
          
        </div>
      </div>
    </div>
    
      
    
  );
}

export default Login;
